import{_ as e,c as a,o,aa as d}from"./chunks/framework.Dn391DXe.js";const b=JSON.parse('{"title":"一.Markdown语法","description":"","frontmatter":{},"headers":[],"relativePath":"workflow/index.md","filePath":"workflow/index.md","lastUpdated":1741433473000}'),t={name:"workflow/index.md"},r=d('<p>[toc]</p><h1 id="一-markdown语法" tabindex="-1">一.Markdown语法 <a class="header-anchor" href="#一-markdown语法" aria-label="Permalink to &quot;一.Markdown语法&quot;">​</a></h1><h3 id="_1-标题" tabindex="-1">1.标题 <a class="header-anchor" href="#_1-标题" aria-label="Permalink to &quot;1.标题&quot;">​</a></h3><p>#的个数对应几级标题，快捷键<code>Ctrl+1（2，3，4，5，6）Ctrl+0</code>表示段落</p><h3 id="_2-字体" tabindex="-1">2.字体 <a class="header-anchor" href="#_2-字体" aria-label="Permalink to &quot;2.字体&quot;">​</a></h3><h5 id="斜体文本" tabindex="-1">斜体文本 <a class="header-anchor" href="#斜体文本" aria-label="Permalink to &quot;斜体文本&quot;">​</a></h5><p>用<code>*</code>或<code>_</code>括住，快捷键<code>Ctrl+I</code></p><h5 id="粗体文本" tabindex="-1">粗体文本 <a class="header-anchor" href="#粗体文本" aria-label="Permalink to &quot;粗体文本&quot;">​</a></h5><p>用<code>**</code>或<code>__</code>括住，快捷键<code>Ctrl+B</code></p><h5 id="粗斜体文本" tabindex="-1">粗斜体文本 <a class="header-anchor" href="#粗斜体文本" aria-label="Permalink to &quot;粗斜体文本&quot;">​</a></h5><p>用<code>***</code>或<code>___</code>括住</p><h3 id="_3-各种线" tabindex="-1">3.各种线 <a class="header-anchor" href="#_3-各种线" aria-label="Permalink to &quot;3.各种线&quot;">​</a></h3><h5 id="分割线" tabindex="-1">分割线 <a class="header-anchor" href="#分割线" aria-label="Permalink to &quot;分割线&quot;">​</a></h5><p>使用三个及以上的 <code>+</code> 号或 <code>*</code> 号或 <code>-</code> 来表示</p><h5 id="删除线" tabindex="-1">删除线 <a class="header-anchor" href="#删除线" aria-label="Permalink to &quot;删除线&quot;">​</a></h5><p>用<code>~~</code>括住，快捷键<code>Alt+Shift+5</code></p><h5 id="下划线" tabindex="-1">下划线 <a class="header-anchor" href="#下划线" aria-label="Permalink to &quot;下划线&quot;">​</a></h5><p>使用HTML的标签<code>&lt;u&gt;</code>和<code>&lt;/u&gt;</code>表示增加下划线的文本，如：<code>&lt;u&gt;</code>要增加下划线的文本<code>&lt;/u&gt;</code>,快捷键<code>Ctrl+U</code></p><h3 id="_4-列表" tabindex="-1">4.列表 <a class="header-anchor" href="#_4-列表" aria-label="Permalink to &quot;4.列表&quot;">​</a></h3><h5 id="无序列表" tabindex="-1">无序列表 <a class="header-anchor" href="#无序列表" aria-label="Permalink to &quot;无序列表&quot;">​</a></h5><p>可以使用<code>*</code>，<code>+</code>或<code>-</code>标记符号来表示无序列表项</p><ul><li>第一项</li><li>第二项</li></ul><h5 id="有序列表" tabindex="-1">有序列表 <a class="header-anchor" href="#有序列表" aria-label="Permalink to &quot;有序列表&quot;">​</a></h5><p>用数字加上<code>.</code>再加上空格来表示有序列表</p><ol><li>第一项</li><li>第二项</li><li>第三项</li></ol><h5 id="嵌套列表" tabindex="-1">嵌套列表 <a class="header-anchor" href="#嵌套列表" aria-label="Permalink to &quot;嵌套列表&quot;">​</a></h5><p>首先使用<code>*</code>、<code>+</code>或<code>-</code>进入列表，然后回车换行，会发现系统自动生成列表第二项，此时按下<code>Tab</code>键，列表第二项变为第一项的子列表。按回车退出当前列表</p><ul><li>y <ul><li>er</li></ul></li></ul>',28),c=[r];function l(i,h,n,s,u,_){return o(),a("div",null,c)}const q=e(t,[["render",l]]);export{b as __pageData,q as default};
